import React from "react";
import { Card } from "react-bootstrap";

const Favourites =(props)=>{
    return(
        <>
            {
                props.item.map(i=>(
                    <div className="favouriteCard">
                        <Card>
                    <Card.Img variant="top" src={i.strMealThumb} alt="dish" />
                    <Card.Body>
                        <Card.Title>{i.strMeal}</Card.Title>
                        <Card.Text>
                        {i.strInstructions}
                        </Card.Text>
                    </Card.Body>
                    </Card>
                    </div>
                ))
            }
        </>
    )
}

export default Favourites;
